import {Link as RouterLink} from 'react-router-dom';
import {Link as ScrollLink} from 'react-scroll';

function Nav(){
    return(
        <nav>
            <ul>
                <li className='nav-item'><ScrollLink to="About-Section" smooth={true} duration={500}>About</ScrollLink></li>
                <li className='nav-item'><a href="#About-Section">Menu</a></li>
                <li className='nav-item'><a href="#">Reservations</a></li>
                <li className='nav-item'><a href="#">Order Online</a></li>
                <li className='nav-item'><a href="#">Login</a></li>
            </ul>
        </nav>
    )
}

export default Nav
